description:
Comissão de Segurança Pública (CSP) realiza reunião deliberativa com item único. PL 1.431/2021 que determina a prioridade de tramitação em todas as instâncias para ações penais que apurem crimes contra a Administração Pública e para ações civis por ato de improbidade administrativa. 

À mesa, presidente da CSP, senador Sérgio Petecão (PSD-AC). 

Bancada: 
senador Fabiano Contarato (PT-ES) - em pronunciamento; 
senador Alessandro Vieira (PSDB-SE); 
senador Sergio Moro (União-PR); 
senador Jorge Kajuru (PSB-GO); 
senador Hamilton Mourão (Republicanos-RS); 
senador Esperidião Amin (PP-SC). 

Foto: Edilson Rodrigues/Agência Senado
